function ToDoRowItem(props) {
    const object = props;

    return(
        <tr>
            <th scope="row">{object.rowNumber}</th>
            <td>{props.rowDes}</td>
            <td>{props.rowAss}</td>
        </tr>
    )
}

export default ToDoRowItem;
